import React, { useState, useEffect } from "react";
import axios from "axios";
import "./index.css";
import { FaStar } from "react-icons/fa";

function App() {
  const [city, setCity] = useState("");
  const [weatherData, setWeatherData] = useState([]);
  const [favorites, setFavorites] = useState([]);
  const [showDropdown, setShowDropdown] = useState(false);

  const handleSearch = async () => {
    if (!city) return;
    try {
      const res = await axios.get(
        `http://localhost:3001/weather/cities?city=${city}`
      );
      setWeatherData([...weatherData, res.data]);
      setCity("");
    } catch (err) {
      console.error("Error fetching weather:", err);
    }
  };

  const toggleDropdown = () => {
    setShowDropdown(!showDropdown);
  };

  const addFavorite = (cityName) => {
    if (!favorites.includes(cityName)) {
      setFavorites([...favorites, cityName]);
    }
  };

  const clearFavorites = () => {
    setFavorites([]);
  };

  return (
    <div className="app">
      <div className="header">
        <span className="header-title">Weather App</span>

        {/* Favorites Button */}
        <div
          className="favorites-container"
          onMouseLeave={() => setShowDropdown(false)}
        >
          <button
            className="favorite-btn"
            title="Add/View Favorites"
            onClick={toggleDropdown}
          >
            <FaStar /> Favorites
          </button>

          {showDropdown && (
            <div className="favorites-dropdown">
              <p onClick={() => alert(favorites.join(", ") || "No favorites")}>
                View Favorites
              </p>
              <p onClick={clearFavorites}>Clear Favorites</p>
              <p onClick={() => alert("More settings coming soon!")}>
                Other Options
              </p>
            </div>
          )}
        </div>
      </div>

      {/* Search bar */}
      <div className="search-bar">
        <input
          type="text"
          placeholder="Enter city"
          value={city}
          onChange={(e) => setCity(e.target.value)}
        />
        <button onClick={handleSearch}>Search</button>
      </div>

      {/* Cards */}
      <div className="card-container">
        {weatherData.map((weather, index) => (
          <div className="card animate-card" key={index}>
            <div className="top-division">
              <div className="top-leftDivision">
                <h3 className="city-name">{weather.city}</h3>
                <p className="city-time">{weather.time}</p>
                <p className="weather-description">{weather.description}</p>
              </div>
              <div className="top-rightDivision temp-content">
                <h2 className="temp">{weather.temperature}°C</h2>
                <p className="temp-min">Min: {weather.min_temp}°C</p>
                <p className="temp-max">Max: {weather.max_temp}°C</p>
              </div>
            </div>
            <div className="bottom-division">
              <div className="extra-details">Humidity: {weather.humidity}%</div>
              <div className="wind-speed">Wind: {weather.wind_speed} km/h</div>
              <div className="sun">Feels: {weather.feels_like}°C</div>
            </div>

            {/* Add to favorites per card */}
            <button
              className="favorite-btn"
              onClick={() => addFavorite(weather.city)}
            >
              <FaStar /> Add to Favorites
            </button>
          </div>
        ))}
      </div>
    </div>
  );
}

export default App;
